CREATE TABLE `tagihan_detail` (
  `id` int(11) NOT NULL,
  `tagihan_id` int(11) DEFAULT NULL,
  `kategori_pembiayaan` enum('a','s','p','d','l') DEFAULT NULL,
  `diskon_id` int(11) DEFAULT NULL,
  `kode` varchar(255) DEFAULT NULL,
  `nama` varchar(255) DEFAULT NULL,
  `nominal` varchar(255) DEFAULT NULL,
  `qty` int(11) DEFAULT NULL,
  `potongan` int(11) DEFAULT NULL,
  `sub_total` int(11) DEFAULT NULL,
  `total` int(11) DEFAULT NULL,
  `komisi` int(11) DEFAULT NULL,
  `pembiayaan_id` int(11) DEFAULT NULL,
  `system` tinyint(1) DEFAULT NULL,
  `tanggal_iuran_mulai` date DEFAULT NULL,
  `tanggal_iuran_berakhir` date DEFAULT NULL,
  `bulan` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

